$_MODULE['<{ssbhesabfa}prestashop>configure_c7abe2e8d68b6dffe0c60f15423a6e89'] = 'این ماژول فروشگاه شما را به نرم افزار حسابداری آنلاین حسابفا متصل می کند. به وسیله ی این ماژول کالاها، مشتریان و سفارشات شما به محض ثبت در سیستم فروشگاه، در حسابفا نیز بصورت خودکار ثبت و ذخیره می شوند. همچنین با پرداخت مشتری، سند دریافت وجه از مشتری نیز در حسابفا ثبت می شود. بدیهی است برای استفاده از این ماژول باید ابتدا یک حساب کاربری در حسابفا داشته باشید. برای این کار می توانید به وب سایت حسابفا به آدرس www.hesabfa.com سر بزنید و به رایگان ثبت نام کنید. پس از ثبت نام در حسابفا و ورود به حساب خود، و سپس ورود به یک کسب و کار، در قسمت تنظیمات / API می توانید کلید API مربوط به کسب و کار خود را دریافت و در قسمت تنظیمات این ماژول وارد نمایید. پس از آن ماژول شما آماده استفاده است.';
$_MODULE['<{ssbhesabfa}prestashop>configure_f3040b4bea7728271ff79304e9d196e7'] = 'برای کسب اطلاعات بیشتر و راهنمای استفاده از حسابفا و ماژول پرستاشاپ به وب سایت حسابفا، قسمت مدرسه حسابداری مراجعه کنید.';
